Create database if not exists Grupa342C4_SavaDragos;
use Grupa342C4_SavaDragos;

CREATE TABLE IF NOT EXISTS Timetable (
    id                      INT(3) UNSIGNED AUTO_INCREMENT PRIMARY KEY NOT NULL,
    Monday                	VARCHAR(11),
    Tuesday                 VARCHAR(11),
    Wednesday             	VARCHAR(11),
    Thursday               	VARCHAR(11),
	Friday					VARCHAR(11),
	Saturday				VARCHAR(11),
	Sunday					VARCHAR(11)
);

CREATE TABLE IF NOT EXISTS Clinic (
    id                      INT(3) UNSIGNED AUTO_INCREMENT PRIMARY KEY NOT NULL,
    name                	VARCHAR(25) NOT NULL,
    address                  VARCHAR(40) NOT NULL,
    timetable_id            INT(3) UNSIGNED NOT NULL,
	FOREIGN KEY(timetable_id) REFERENCES Timetable(id) ON UPDATE CASCADE ON DELETE CASCADE
);

CREATE TABLE IF NOT EXISTS medical_service (
    id                      INT(3) UNSIGNED AUTO_INCREMENT PRIMARY KEY NOT NULL,
	speciality              varchar(40) NOT NULL
);

CREATE TABLE IF NOT EXISTS Patient (
	id                      		INT(5) UNSIGNED AUTO_INCREMENT PRIMARY KEY NOT NULL,
    first_name                      varchar(20) NOT NULL,
	last_name                       varchar(20) NOT NULL,
    address                         varchar(30),
    phone_number                    varchar(10) NOT NULL,
    email                           varchar(35),
    registered                      varchar(1)
);

#asociere intre clinica si serviciileoferite de aceasta
CREATE TABLE IF NOT EXISTS services (
    id                      	INT(5) UNSIGNED AUTO_INCREMENT PRIMARY KEY NOT NULL,
	clinic_id               	INT(3) UNSIGNED,
    medical_service_id          INT(3) UNSIGNED,
	FOREIGN KEY(clinic_id) REFERENCES Clinic(id) ON UPDATE CASCADE ON DELETE CASCADE,
    FOREIGN KEY(medical_service_id) REFERENCES medical_service(id) ON UPDATE CASCADE ON DELETE CASCADE
);

CREATE TABLE IF NOT EXISTS Investigation (
    id                      INT(5) UNSIGNED AUTO_INCREMENT PRIMARY KEY NOT NULL,
    name                    VARCHAR(255) NOT NULL,
    duration                int(3),
    price                 	INT(5) UNSIGNED,
    ability               	VARCHAR(50) NOT NULL
);

CREATE TABLE IF NOT EXISTS investigations_assoc (
    id                      INT(5) UNSIGNED AUTO_INCREMENT PRIMARY KEY NOT NULL,
	medical_service_id      INT(3) UNSIGNED,
    investigation_id        INT(5) UNSIGNED,
	FOREIGN KEY(investigation_id) REFERENCES Investigation(id) ON UPDATE CASCADE ON DELETE CASCADE,
    FOREIGN KEY(medical_service_id) REFERENCES medical_service(id) ON UPDATE CASCADE ON DELETE CASCADE
);



CREATE TABLE IF NOT EXISTS User (
    personal_identifier             BIGINT(10) UNSIGNED PRIMARY KEY NOT NULL,
    first_name                      varchar(20),
	last_name                       varchar(20),
    address                         varchar(30),
    phone_number                    varchar(10),
    email                           varchar(35),
    IBAN_account                    varchar(25),
    contract_number                 varchar(10),
	hire_date                       date not null,
	position                        varchar(25),
	salary                          int(7),
	working_hours                   int(3),
    paraph_code						varchar(6),
    scientific_title                varchar(30),
    didactic_chair                  varchar(30),
	username                        varchar(30),
	password                        varchar(20)
);


CREATE TABLE IF NOT EXISTS Reservation(
    id                              INT(5) UNSIGNED AUTO_INCREMENT PRIMARY KEY NOT NULL,
    reservation_date                DATE NOT  NULL,
    clinic_id                       INT(3) UNSIGNED NOT NULL,
    patient_id                      INT(5) UNSIGNED NOT NULL,
    medical_service_id              INT(5) UNSIGNED NOT NULL,
    medic_id                        BIGINT(10) UNSIGNED NOT NULL,
    weekday                         VARCHAR(25) NOT NULL,
    time_slot                       VARCHAR(11) NOT NULL,
    FOREIGN KEY(clinic_id) REFERENCES Clinic(id) ON UPDATE CASCADE ON DELETE CASCADE,
    FOREIGN KEY(medic_id) REFERENCES User(personal_identifier) ON UPDATE CASCADE ON DELETE CASCADE,
    FOREIGN KEY(patient_id) REFERENCES Patient(id) ON UPDATE CASCADE ON DELETE CASCADE,
    FOREIGN KEY(medical_service_id) REFERENCES medical_service(id) ON UPDATE CASCADE ON DELETE CASCADE
);

CREATE TABLE IF NOT EXISTS reservation_investigations_assoc (
    id                      INT(5) UNSIGNED AUTO_INCREMENT PRIMARY KEY NOT NULL,
	reservation_id      	INT(5) UNSIGNED,
    investigation_id        INT(5) UNSIGNED,
	FOREIGN KEY(investigation_id) REFERENCES Investigation(id) ON UPDATE CASCADE ON DELETE CASCADE,
    FOREIGN KEY(reservation_id) REFERENCES Reservation(id) ON UPDATE CASCADE ON DELETE CASCADE
);

#fiecare Schedule va corespunde unui user
#in viitor daca va fi nevoie il sparg intr-o tabela assoc
CREATE TABLE IF NOT EXISTS Schedule (
    id                      				INT(5) UNSIGNED AUTO_INCREMENT PRIMARY KEY NOT NULL,
    weekday                					VARCHAR(25) NOT NULL,
    time_slot                				VARCHAR(11) NOT NULL,
    location             					VARCHAR(25),
    user_personal_identifier				BIGINT(10)  UNSIGNED ,
    FOREIGN KEY(user_personal_identifier) REFERENCES User(personal_identifier) ON UPDATE CASCADE ON DELETE CASCADE
);

CREATE TABLE IF NOT EXISTS specific_schedule (
    id                                      INT(5) UNSIGNED AUTO_INCREMENT PRIMARY KEY NOT NULL,
    specific_date                           DATE NOT NULL,
    weekday                                 VARCHAR(25),
    time_slot                               VARCHAR(11),
    location                                VARCHAR(25),
    user_personal_identifier                BIGINT(10)  UNSIGNED ,
    holiday                                 VARCHAR(1),
    FOREIGN KEY(user_personal_identifier) REFERENCES User(personal_identifier) ON UPDATE CASCADE ON DELETE CASCADE
);

CREATE TABLE IF NOT EXISTS speciality (
    id                      INT(3) UNSIGNED AUTO_INCREMENT PRIMARY KEY NOT NULL,
    name                    VARCHAR(50) NOT NULL,
	degree       			VARCHAR(25)
);

CREATE TABLE IF NOT EXISTS specialities (
    id                      	INT(5) UNSIGNED AUTO_INCREMENT PRIMARY KEY NOT NULL,
	user_id               		BIGINT(10) UNSIGNED,
    speciality_id          		INT(3) UNSIGNED,
	FOREIGN KEY(speciality_id) REFERENCES speciality(id) ON UPDATE CASCADE ON DELETE CASCADE,
    FOREIGN KEY(user_id) REFERENCES User(personal_identifier) ON UPDATE CASCADE ON DELETE CASCADE
);


CREATE TABLE IF NOT EXISTS ability (
    id                      INT(3) UNSIGNED AUTO_INCREMENT PRIMARY KEY NOT NULL,
    name                    VARCHAR(50) NOT NULL
);

#asociere intre user si abilitati
CREATE TABLE IF NOT EXISTS abilities (
    id                      	INT(5) UNSIGNED AUTO_INCREMENT PRIMARY KEY NOT NULL,
	user_id               		BIGINT(10) UNSIGNED,
    ability_id          		INT(3) UNSIGNED,
	FOREIGN KEY(user_id) REFERENCES User(personal_identifier) ON UPDATE CASCADE ON DELETE CASCADE,
    FOREIGN KEY(ability_id) REFERENCES ability(id) ON UPDATE CASCADE ON DELETE CASCADE
);

CREATE TABLE IF NOT EXISTS Raport (
    id                          INT(5) UNSIGNED AUTO_INCREMENT PRIMARY KEY NOT NULL,
    patient_first_name              varchar(20) not null,
    patient_last_name               varchar(20) not null,
    medic_first_name                varchar(20) not null,
    medic_last_name                 varchar(20) not null,
    reservation_date                Date not null,
    medical_service                 varchar(20) not null,             
    istoric                         varchar(255),
    simptome                        varchar(255),
    diagnostic                      varchar(255),
    recomandari                     varchar(255),
    paraph_code                     varchar(6)
);

CREATE TABLE IF NOT EXISTS istoric (
    id                          INT(5) UNSIGNED AUTO_INCREMENT PRIMARY KEY NOT NULL,
    user_id                     BIGINT(10) UNSIGNED,
    ability_id                  INT(3) UNSIGNED,
    FOREIGN KEY(user_id) REFERENCES User(personal_identifier) ON UPDATE CASCADE ON DELETE CASCADE,
    FOREIGN KEY(ability_id) REFERENCES ability(id) ON UPDATE CASCADE ON DELETE CASCADE
);




